import React from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { useEffect } from 'react'
import { searchPokemonsById } from '../store/actions'
import { Link } from 'react-router-dom'

export default function Details() {
  let details = useSelector((state) => state.details)
  let dispatch = useDispatch()
  useEffect(() => {
    dispatch(searchPokemonsById(1))
  }, [dispatch])
  console.log(details)
  return (
    <div>
        <h1>{details[0].name.toUpperCase()}</h1>
        <img src={details[0].image} alt="NOT FOUND" width="400" height="400" />
        <p> Defense: {details[0].defense}</p>
        <p> Attack: {details[0].Attack}</p>
       
    </div>
  )
}
